import React from "react";
import events from "./data/allevents.json"
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import EventCard from "./previews/EventCard";
export class Home extends React.Component {
  constructor(props) {
    super(props);
    console.log(this.props); // props will get logged.
    this.state = {
      all_events: [],
    };
  }
  componentDidMount() {
    console.log("mounting");
    // console.log(all_events);
    this.loadEvents();
  }

  loadEvents() {
  //   // axios.get(
  //   //   "http://localhost:5000/events").then((res) => {
  //   //     this.setState({
  //   //       all_events: res.data.reverse(),
  //   //     });
  //   //   });

    this.setState({
      all_events: [
        {
            "id": 1,
            "organizer_employee_id": "jane.doe",
            "name": "Volunteering Activity @ Sun Plaza Park",
            "date": "20/03/2021",
            "time": "09:00 AM– 11:00 AM",
            "location": "407 Tampines Street 41 Sun Plaza Green Singapore 520407",
            "info_for_participants": "The event will be cancelled in the event of wet weather. ",
            "registration_opens_on": "2021-03-10T00:00:00",
            "registration_closes_on": "2021-03-17T00:00:00",
            "capacity": 10,
            "fill": 2,
            "image": "https://pbs.twimg.com/media/Dap2TNXWAAAXn8i.jpg",
            "tags": "outdoor"
        },
        {
            "id": 2,
            "organizer_employee_id": "jane.doe",
            "name": "Morning Walk / Walk For Rice @ Kallang",
            "date": "16/01/2022",
            "time": "07:00 AM– 11:00 AM",
            "location": "8 Stadium Boulevard Home of Athletics (HOA) Singapore 397804",
            "info_for_participants": "Volunteers are required to assist the Kallang ActiveSG team in the following:",
            "registration_opens_on": "2021-12-29T00:00:00",
            "registration_closes_on": "2022-01-12T00:00:00",
            "capacity": 30,
            "fill": 1,
            "image": "https://pbs.twimg.com/media/Dap2TNXWAAAXn8i.jpg",
            "tags": "outdoor"
        },
        {
          "id": 3,
          "organizer_employee_id": "jane.doe",
          "name": "Dog Walking @ Pasir Ris Dog Shelter",
          "date": "30/01/2022",
          "time": "07:00 AM– 11:00 AM",
          "location": "Pasir Ris Park Singapore 397804",
          "info_for_participants": "Please join us to walk these cute dogs! ",
          "registration_opens_on": "2021-12-29T00:00:00",
          "registration_closes_on": "2022-01-12T00:00:00",
          "capacity": 30,
          "fill": 1,
          "image": "https://images.unsplash.com/photo-1582118315271-53d7fd6630e1?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2370&q=80",
          "tags": "outdoor"
      }
    ],
    });
    console.log(this.state.all_events)
  }
  render() {
    return (
      <div className="absolute w-full h-full">
         {/* Navbar for logo */}
         <nav class="relative flex flex-col h-24 px-6 bg-gradient-to-r from-[#ffa53b] to-[#f6c790] w-full">
            <div class="flex flex-row">
                <div class="self-center mr-2">
                    <a href="/home"><img class="h-10 w-10 absolute left-4 top-6" src={process.env.PUBLIC_URL + '/CS Logoooo.PNG'} alt="Credit Suisse Logo" /></a>
                </div>
                <div>
                    {/* relative for nav and absolute for the individual texts to set their positions */}
                    <a href="/home" class="text-2xl no-underline text-[#013156] font-bold absolute left-16 top-4">Credit Suisse</a><br/>
                    <a href="/home"class="text-s text-[#013156] absolute left-24 top-12">Volunteer</a>
                </div>
            </div>

            <div class="sm:mb-0 self-end pt-1 pr-5">
                <a href="#" class="text-lg no-underline text-[#013156] hover:text-[#b27329] ml-8">Browse</a>
                <a href="#" class="text-lg no-underline text-[#013156] hover:text-[#b27329] ml-8">Enrolled</a>
                <button class="bg-[#ffae4e] hover:bg-[#ffa53b] text-[#013156] font-bold ml-8 py-2 px-4 rounded-full">+ New</button>
                <a href="#" class="text-lg no-underline text-[#013156] hover:text-[#b27329] ml-8">Log out</a>
            </div>
        </nav>

        {/* Search bar */}
        <div class="flex mt-10 justify-center items-center">
            <div class="relative"> <input type="text" class="h-14 w-96 pl-5 rounded z-0 focus:shadow focus:outline-none" placeholder="Search anything..." />
                <div class="absolute top-4 right-3"> <i class="fa fa-search text-gray-400 z-20 hover:text-gray-500 pr-3"></i> </div>
            </div>
        </div>
          <div className="container mx-auto flex items-center flex-wrap pt-4 pb-12">
          {this.state.all_events.map((event) => (
            <EventCard event={event} key={event.id} />
          ))}
          </div>

      </div>
    );
  }
}

export default Home;
